import React from 'react';
import styled from 'styled-components';
import './index.css';

export const Column: React.FC = () => {
  return (
    <StyledColumn>
      <StyledColumnHeader>
        <div className='b'>Title name</div>
        <div className='c'>...</div>
      </StyledColumnHeader>
    </StyledColumn>
  );
}

const StyledColumn = styled.div`
  min-height: 70px;
  width: 272px;
  background-color: #EBECF0;
  border-radius: 10px;
  margin: 10px;
  display: flex;
  flex-direction: column;
  padding: 5px;
`;

const StyledColumnHeader = styled.div`
  background-color: rgb(216, 189, 68);
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
`;
